import React from 'react';
import logo from '../logo.svg';
import '../App.css';

const QuizComplete = () => {
    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <p>
                The quiz is complete!
                Here is your car!
                </p>
                Picture goes Here
            </header>
        </div>
    )
}

export default QuizComplete
